import { TestBed } from '@angular/core/testing';
import { ChefPanelComponent } from './chef-panel.component';
import { RouterTestingModule } from '@angular/router/testing';
import { HttpClientTestingModule } from '@angular/common/http/testing';
import { CUSTOM_ELEMENTS_SCHEMA } from '@angular/core';
import { Router } from '@angular/router';
describe('ChefPanelComponent', () => {
    let component;
    let fixture;
    beforeEach(async () => {
        let routerSpy = jasmine.createSpy('navigate');
        await TestBed.configureTestingModule({
            declarations: [ChefPanelComponent],
            providers: [
                { provide: Router }
            ],
            imports: [
                RouterTestingModule,
                HttpClientTestingModule
            ],
            schemas: [CUSTOM_ELEMENTS_SCHEMA]
        })
            .compileComponents();
        fixture = TestBed.createComponent(ChefPanelComponent);
        component = fixture.componentInstance;
        fixture.detectChanges();
    });
    // beforeEach(() => {
    //   fixture = TestBed.createComponent(ChefPanelComponent);
    //   component = fixture.componentInstance;
    //   fixture.detectChanges();
    // });
    it('should create', () => {
        expect(component).toBeTruthy();
    });
    it(`should navigate to nocustomer`, () => {
        expect(routerSpy.navigate).toHaveBeenCalledWith(['/nocustomer']);
    });
});
